import React, { useState } from 'react';
import axios from 'axios';

function Contact() {
  const [form, setForm] = useState({ name: '', email: '', message: '' });
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState('');

  const handleChange = e => {
    setForm(f => ({ ...f, [e.target.name]: e.target.value }));
  };

  const handleSubmit = async e => {
    e.preventDefault();
    setLoading(true);
    setMessage('');
    try {
      await axios.post('/api/auth/contact', form);
      setMessage('Your message has been sent!');
      setForm({ name: '', email: '', message: '' });
    } catch (err) {
      setMessage('Could not send your message.');
    }
    setLoading(false);
  };

  return (
    <div style={{ background: '#181A20', minHeight: '100vh', padding: '0 0 2rem 0' }}>
      <section className="responsive-section responsive-flex" style={{
        maxWidth: '1000px',
        margin: '0 auto',
        padding: '3rem 1rem',
        display: 'flex',
        flexWrap: 'wrap',
        gap: '2.5rem',
        justifyContent: 'center',
      }}>
        {/* Contact Info */}
        <div className="responsive-card" style={{ flex: '1 1 300px', minWidth: '260px', maxWidth: '340px', background: '#23272F', borderRadius: '1.2rem', boxShadow: '0 2px 12px rgba(0,0,0,0.06)', padding: '2.2rem 1.5rem', marginBottom: '1rem', display: 'flex', flexDirection: 'column', gap: '1.2rem', justifyContent: 'space-between', color: '#E5E7EB' }}>
          <div>
            <h2 style={{ color: '#0057D9', fontWeight: 700, fontSize: '1.4rem', marginBottom: '1.2rem' }}>Contact Information</h2>
            <div style={{ color: '#E5E7EB', marginBottom: '1rem' }}>
              <span style={{ color: '#2ECC71', fontWeight: 700 }}>Address:</span><br />
              Roorkee, Uttarakhand, INDIA
            </div>
            <div style={{ color: '#E5E7EB', marginBottom: '1rem' }}>
              <span style={{ color: '#2ECC71', fontWeight: 700 }}>Phone:</span><br />
              <a href="tel:+919027880288" style={{ color: '#0057D9', textDecoration: 'none', fontWeight: 600 }}>+91 9027880288</a>
            </div>
            <div style={{ color: '#E5E7EB' }}>
              <span style={{ color: '#2ECC71', fontWeight: 700 }}>Email:</span><br />
              <a href="mailto:official.customweb@gmail.com" style={{ color: '#0057D9', textDecoration: 'none', fontWeight: 600 }}>official.customweb@gmail.com</a>
            </div>
          </div>
          <div style={{ borderRadius: '0.7rem', overflow: 'hidden', marginTop: '1.2rem', boxShadow: '0 2px 8px rgba(0,87,217,0.08)' }}>
            <iframe
              title="Custom Web Location"
              src="https://www.google.com/maps?q=Roorkee,+Uttarakhand,+India&output=embed"
              width="100%"
              height="140"
              style={{ border: 0 }}
              allowFullScreen=""
              loading="lazy"
              referrerPolicy="no-referrer-when-downgrade"
            ></iframe>
          </div>
        </div>
        {/* Contact Form */}
        <form onSubmit={handleSubmit} className="responsive-card" style={{ flex: '1 1 350px', minWidth: '260px', maxWidth: '420px', background: '#23272F', borderRadius: '1.2rem', boxShadow: '0 2px 12px rgba(0,0,0,0.06)', padding: '2.2rem 1.5rem', display: 'flex', flexDirection: 'column', gap: '1.2rem', border: '2px solid #2ECC71', color: '#E5E7EB' }}>
          <h2 style={{ color: '#0057D9', fontWeight: 700, fontSize: '1.4rem', marginBottom: '1rem' }}>Send Us a Message</h2>
          <input
            type="text"
            name="name"
            placeholder="Your Name"
            value={form.name}
            onChange={handleChange}
            required
            style={{ padding: '0.8rem', borderRadius: '0.5rem', border: '1px solid #333', fontSize: '1rem', background: '#23272F', color: '#E5E7EB' }}
          />
          <input
            type="email"
            name="email"
            placeholder="Your Email"
            value={form.email}
            onChange={handleChange}
            required
            style={{ padding: '0.8rem', borderRadius: '0.5rem', border: '1px solid #333', fontSize: '1rem', background: '#23272F', color: '#E5E7EB' }}
          />
          <textarea
            name="message"
            placeholder="Your Message"
            value={form.message}
            onChange={handleChange}
            required
            rows={5}
            style={{ padding: '0.8rem', borderRadius: '0.5rem', border: '1px solid #333', fontSize: '1rem', resize: 'vertical', background: '#23272F', color: '#E5E7EB' }}
          />
          <button type="submit" style={{
            background: '#2ECC71',
            color: '#181A20',
            padding: '0.9rem',
            border: 'none',
            borderRadius: '0.5rem',
            fontWeight: 700,
            fontSize: '1.1rem',
            cursor: 'pointer',
            marginTop: '0.5rem',
            borderBottom: '3px solid #FF6B35',
          }}>{loading ? 'Sending...' : 'Send Message'}</button>
          {message && <div style={{ color: message.includes('sent') ? '#2ECC71' : '#FF6B35', textAlign: 'center', marginTop: '0.5rem' }}>{message}</div>}
        </form>
      </section>
    </div>
  );
}

export default Contact;
